import React from "react";
import Navbar from "./essentials/Navbar";

export default function Dashboard() {
  return (
    <>
      <title>Dashboard</title>
      <div className="container-fluid">
        <div className="p-2 p-xl-3 p-lg-3 p-sm-2 p-md-3"></div>
      </div>
    </>
  );
}
